        "announcement": "•     •     •     •     •    For even more, visit www.hattonhenry.com   •     •     •     •     •     \n\nGorgeous leather bags and accessories, handmade in Austin, Texas.\n\n•     •     •     •     •     •     •     •     •     •     •     •    \n\nEvery single leather tote, wallet, pouch, cross body bag, keychain, cord keeper, and other leather good is handmade from start to finish in a small Austin, Texas studio by a small team of hardworking ladies.\n\nEvery. Single. Dang. One.\n\nSee what customers are saying:  https://www.etsy.com/shop/HattonHenry#reviews\n\nRECENT PRESS \n\n☄ Texas Monthly : https://www.etsy.com/shop/HattonHenry\nhttp://www.texasmonthly.com/the-culture/hatton-henry/\n\n☄ Mucho Mucho Bueno Bueno Blog : \nhttp://www.muchomuchobuenobueno.com/blog/2016/5/2/whats-in-my-bag-hatton-henry-bucket-bag\n\n☄ Feliz Austin Market Blog : http://www.felizaustin.com/blog/2015/10/20/hatton-henry\n\n☄ Renegade Craft Fair Blog : http://www.renegadecraft.com/maker-spotlight-hatton-henry\n\n•     •     •     •     •     •     •     •     •     •     •     •     \n\nFOLLOW ALONG\n\nSHARE   |   Tag your photos with #myhattonhenry!  Select snaps will be featured!\n \nINSTAGRAM    |    @hattonhenry\n\nWEBSITE    |    hattonhenry.com\n\nREVIEWS    |    https://www.etsy.com/shop/HattonHenry/reviews\n\nPRESS   |   hattonhenry.com/press\n\nWHOLESALE   |  hattonhenry.faire.com\n\nCUSTOM INQUIRIES   |   Sorry, but we are not accepting custom orders at this time.\n\n•     •     •     •     •     •     •     •     •     •     •     •     \n\nWe love wholesale - find us at HattonHenry.faire.com!\n\nABOUT OUR LITTLE BIZ\n\nHatton Henry is a line of leather goods by 4th generation Texas leather worker, Vanessa Vaught. \n\nEach bag is handcrafted, with all the love we can muster (and a few dance moves), in our South Austin studio by a tiny, all-woman team.  All raw materials are proudly sourced from US suppliers.  \n \nOutside of our staple line, we enjoy offering unique, limited edition leathers. Due to the nature of working with natural materials, each item is unique and one of a kind.\n\nWhen we&#39;re not making bags, we&#39;re running around Lady Bird Lake, dancing our hearts out in the local honky tonks, or hopping into Barton Springs.\nWe love what we do!  We hope you do, too. \n\nA FAMILY TRADITION\n\nA Family Tradition\nOur shop is the namesake of two true American entrepreneurs, George Hatton Vaught and George Henry Vaught (Vanessa&#39;s Grandpa). Better known to the saddle making world as G.H. Vaught & Son, they produced saddles, harnesses, men&#39;s belts, and more out of their Rockwall, Texas-based leather workshop for nearly 100 years.  \n\nHatton Henry is dedicated to them. ♡\n\n•     •     •     •     •     •     •     •     •     •     •     •     \n\n• All Content ©2013-2019 Hatton Henry •",
