        "creation_tsz": 1176506510,
        "title": "Handmade pottery. ",
        "announcement": "In Portland, Oregon? Use the coupon code &quot;localpickup&quot; if you want to come by the studio and save on shipping! I&#39;m in NE- Alberta/Woodlawn/Concordia.\r\n\r\nWelcome to my little pottery shop! Everything listed here is handmade using stoneware clay and an electric kiln. My studio is in Portland, Oregon- if you are nearby, you are welcome to visit. Just drop me a line to set-up an appointment-  jeanettezeis [!at] gmail.com",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": "December 10, 2018: Hi! I am taking a few days to catch up on outstanding orders and update my inventory. ❤️ Sorry for the inconvenience and your patience. If you would have any questions, feel free to email me at jeanettezeis@gmail.com\r\n\r\nIf you have an outstanding order with me- it is probably on the way to you. But feel free to send me a convo for an update. \r\n\r\n\r\n",
        "sale_message": "Thank you for your order!  If you have any questions, please convo me via etsy or email jeanettezeis@gmail.com",
        "digital_sale_message": null,
        "last_updated_tsz": 1553558637,
        "listing_active_count": 109,
        "digital_listing_count": 0,
        "login_name": "vesselsandwares",
        "accepts_custom_requests": false,
        "policy_welcome": "Hi!  Thanks for taking a look around my etsy shop.  I make functional pottery.  All of it is food-safe and lead-free.  It is also dishwasher-safe.  If you have any questions regarding my process or the finished pieces, feel free to contact me via etsy, or through email (jeanettezeis@gmail.com)\r\n\r\nMy microwave-safe disclaimer: They are fine for re-heating water-based items and drinks. But, really, it is my opinion and experience that handmade pottery will weaken over time with prolonged microwave-use, eventually leading to cracking. So for the sake of keeping your pottery for many years, please do not use in the microwave.",
        "policy_payment": "PayPal is preferred method of payment and expected at time of order.\r\n  \r\nPersonal checks are also accepted.  Order will not be shipped until check has been received and has cleared (can take up to 2 weeks.)",
        "policy_shipping": "All pottery is packed with care.  It is very important to me that your order arrives safely and swiftly.  \r\n\r\nOrders are shipped using USPS.  I use both parcel post and priority shipping. Usually packages arrive within one week of shipment. I can expedite shipping, if needed- just get in touch for a price quote.\r\n\r\nTracking/delivery confirmation through USPS is always used.\r\n\r\nAll international orders are shipped via USPS First-Class or Priority (depending on the weight.)\r\nInternational shipping charges are very expensive for the heavy breakable pieces. I generally ship first class USPS for international shipments under 4 pounds (a mug is 2 pounds when packed for shipping), and priority for shipments over 4 pounds (10&quot; cake stands are 7 pounds when packed for shipping.) The buyer is responsible for customs fees, VAT, and any other destination country expenses that may be incurred. It is the responsibility of the buyer to pay these charges- I am unable to predict or pay these additional fees.  ",
        "policy_refunds": "If you are unhappy with your purchase, please let me know! I want my pots to be in happy homes.  I&#39;m willing to work with you to ensure a great transaction and satisfaction.\r\n\r\n(Returns must be made within 45 days of purchase.) \r\n\r\nReturns are not accepted for custom items- unless a mistake has been made on my part (in which case, I will offer to remake that item or refund the item.)  \r\n\r\nBuyer pays half of the shipping costs on the return item and is responsible for its secure delivery back to me. Money will not be refunded until the item has been (safely) received by me.\r\n\r\nBreakage:  On the off-chance that there is breakage during shipping, I will refund your purchase or exchange it.  Broken pottery must be photographed and/or returned.",
