        "shop_id": 15019854,
        "shop_name": "LoneStarEtch",
        "user_id": 111708573,
        "creation_tsz": 1522783260,
        "title": "Personalized engraved glassware and more!",
        "announcement": "Welcome to Lone Star Etch! \r\n\r\nWe are setting up our new shop!!! We have adjusted our production time to 7-10 business days while we transition. Business days do not include holidays or weekends. Processing time does not include shipping time.  Our normal production time of 2-3 days will resume as soon as we are finished setting everything into place.  :)\r\n\r\nOnce the order ships, a tracking number will be sent to you. Typical transit time after shipping: 2-4 days (Mon-Sat)\r\n\r\n\r\nAll of the items in our shop are hand sandblasted using a proprietary method that we have developed over years of trial and error. Our method is so finely tuned that we are able to get even the finest details to show up. A sand carved finish is the premier choice when it comes to engraving due to the fact that we can provide a much deeper cut that will last forever.\r\n\r\nTake a look around, and if you have your own ideas, feel free to message us! We love custom orders!",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": "We will resume business on Monday July 30",
        "sale_message": "We greatly appreciate your order and hope you enjoy our engraved glassware! As with most small businesses, a happy customer is our goal and we strive for a good rating!",
        "digital_sale_message": null,
        "last_updated_tsz": 1553575906,
        "listing_active_count": 270,
        "digital_listing_count": 0,
        "login_name": "jake2381",
        "accepts_custom_requests": true,
        "policy_welcome": null,
        "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
        "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
        "policy_refunds": "I GLADLY ACCEPT CANCELLATIONS\nRequest a cancellation within: 2 days of purchase\n\nI DON'T ACCEPT RETURNS OR EXCHANGES\nBut please contact me if you have any problems with your order.",
        "policy_additional": "WHEN WILL MY ORDER SHIP?\nCurrent production time is 2-3 business days. Business days do not include holidays or weekends. \n\nOnce the order ships, a tracking number will be sent to you! Typical transit time after shipping: 2-4 days (Mon-Sat)\n\nIF YOU HAVE A NEED-BY DATE, please send me a message on Etsy either before or after placing your order so I can accommodate. \n\nYour estimated ship date will be in your “purchases” section of the Etsy app or website for your convenience once you place an order. \n\nIf you select an upgraded shipping method, it does not change the production time of 5-8 business days. This only makes the shipping transit time faster. \n\nIf you have any questions about your order or the information above, please feel free to message me!\n\nWILL I RECEIVE AN ART PROOF?\nAll custom designed orders and orders that take personalizations will receive an art proof sent via Etsy messenger within 24 hours of ordering. We will not engrave or ship any item or orders that we have not received art approval for. ***Please note: Failure to approve your art proof in a timely manner will cause production delays and add additional processing time to your order.\n\nWHAT IF MY ITEM ARRIVES BROKEN?\nAlthough it is rare that our items arrive broken or damaged, it occasionally can occur. Should your item(s) arrive damaged or broken we will replace that item(s) for you at no charge. We must be notified within 2 days upon receipt of shipment. We will need photos sent to us of the damaged/broken item as well as photos of the packaging.  We will file a claim with the shipping carrier, so please be sure to save all shipping cartons and packaging for inspection purposes.\n\nENGRAVING AND GLASS QUALITY?\nLone Star Etch has a commitment to quality and we want you to be pleased with your order. To this end, any defects in our engraving will be corrected as quickly as possible, and without charge. \n\n***PLEASE NOTE:  The following are typical characteristics of molded glassware and are not considered flaws, defects, or imperfections. (LSE will not offer refunds or replacements.)\n\n• LITTLE BUMPS: Occasionally, a molded piece of glass will have a tiny bump or two.  This is occurs during the manufacturing process and is quite common in molded glassware.\n\n• TINY BUBBLES: Tiny bubbles that are suspended in the glass are called seeds and are caused by gasses trapped in the molten glass during the manufacturing process. Seeds are quite common.",
