      "title": "EDIBLE SHEET image print, custom liquor label cake topper, cognac cake topper, whiskey cake topper, bourbon cake topper, edible cake topper",
      "description": "★★★★PLEASE NOTE THAT IN ORDER TO HAVE FAST TURNAROUND I NEED TO BE IN CONTACT WITH YOU TO SHOW YOU A PROOF BEFORE I PRINT. THE FASTER YOU RESPOND, THE FASTER I CAN SHIP YOUR ITEM.★★★★ \n\nHigh quality edible image cake topper of any of my liquor labels. Size of sheet is 8.5x11 for quarter sheet cake. Made to order.\n\n\nHow to Order\n\n1. Choose the liquor design you would like printed on edible icing sheet. \n2. Choose whether you want the design to fit the whole 8.5x11 sheet or if you want a custom size.\n3. In the NOTE TO SELLER section of your order let me know what you want your label to say as well as any custom request. If you want a custom size, let me know what size that is in the NOTE TO SELLER as well. \n\n★★ PRODUCT INFORMATION ★★\n\nIcing sheets are edible sheets that made out of icing that melt right onto your frosting! You can use buttercream, frosting or any other cream based icing. Not suitable for fondant as it will not melt onto your fondant. Please store your icing sheet in the original package that it will be shipped to you in until you need to use it. DO NOT store in refrigerator as it will cause your icing sheet to dry and crackle. Please store in a DRY place in it&#39;s original bag, away from direct sunlight or heat source. Store in a place within 65-75 degrees Fahrenheit. Whenever you are ready to use your edible image, simply remove it from it&#39;s bag, remove the cellophane backing and place on top of your cake. \n\nShipping Info\n\nMy shipping time is 1-2 business. Standard shipping takes 3-5 days to get to you after I ship. Priority mail takes 2-3 days and Priority Mail Express 1-2 days. If you have any questions regarding shipping please send me a message!\n\n(Disclaimer: Actual color of edible image may vary slightly from the color on your computer screen and image you provide due to the color gamut available on edible inks)",
