        "announcement": "CHRISTMAS/HOLIDAY SALE 2018!!!!\nHello dear customers! It&#39;s that time of year again! The Holidays are just around the corner so I have started my Holiday sale early this year. From November 19th - December 19th ALL my listings will be 10% off. On top of that discount, if your order is over $50 dollars, I will automatically upgrade your shipping from standard shipping to priority mail, free of any extra charge for you. Essentially you will be getting priority shipping for the price of standard shipping. I will cover the shipping difference, ONLY on orders OVER $50.  If you have any questions please feel free to contact me. Thank you so much for your business and HAPPY HOLIDAYS!!!!\n\nVIDEO TUTORIAL IS UP!!!\nHello dear customers! I have now uploaded a tutorial on how to take off the backing from your label as I have had many customers ask me how to do it. You can find the video below my item reviews on my shop page. I also mention how to take off the old label and how to reposition your new label if needed. I hope you find the tutorial helpful and if not, send me a conversation for further help!\n\nCHRISTMAS/HOLIDAY SALE!!!!\nHi guys! Just letting you know that all my custom labels and stickers will be on sale starting November 20- December 2! Have any questions? Feel free to send me a message! Merry Christmas and Happy Holidays to all, lovingly from Culture Pop Shop!\n\nCHRISTMAS/HOLIDAY LABELS\nChristmas is just around the corner! All my labels can be fully customized to fit all your holiday needs. I can customize them for any holiday message! Please send me a conversation to get started. :D\n\nSHOP UPDATE 10/24/2017\nAll my labels and stickers are now waterproof! \n\nSHOP UPDATE 10/03/2017\nI am now offering PRINTED labels and sticker in my listings! Let me know if you have any questions, comments, concerns, or suggestions. My business is small and growing so any feedback from my beloved customers is very much appreciated! THANK YOU SO MUCH!\n\nSHOP UPDATE 09/24/2017\nMy aim is to have happy, satisfied customers. If at any point you have questions, concerns or comments on how I can make your shopping experience better, PLEASE let me know. I am here to help and to provide full customer service for any of my listings!\n\nPlease read all product descriptions before purchase. Some of my listings are for DIGITAL items. If you order a digital item and then request a refund AFTER I have already sent your files, I cannot issue you a refund but I will try my best to correct any issues you may have had with your order. Furthermore, no refunds will be given for any customized items. Thank you for understanding. If you have any questions before, during, or after purchase, please contact me. :D",
