      "description": "Bison horn is a strong and beautiful material. It tends to be deep black in colour, often with white and grey speckling in sections. We&#39;ve paired it here with a thin sliver of whiskey barrel oak, adding a subtle contrast. Everything is held firmly in place by the featherlight strength of carbon fiber, which has literally been built around the wood and horn. \n\n**Please note that this listing is only for one ring.**\n_________________________________________________________________________________________\n\nCHECK THE SHOP ANNOUNCEMENT FOR UPDATED MANUFACTURING TIMES\nhttps://www.etsy.com/ca/shop/OriginHG?ref=l2-shopheader-name\n\n- Available in sizes 4 - 15. \n- Please ensure your ring has been properly measured at a jewelry store before placing an order!\n- Please specify any custom requests or modifications, such as the width of your ring, in the “note to seller” section during checkout.\n\n*Each ring will look slightly different than the one pictured as every piece of material used is unique*\n\nAny questions? Just message us!\n__________________________________________________________________________________________\n\nIMPORTANT: The customer is responsible for ordering in time for specific dates, acquiring correct sizing, and maintenance of the ring. Please read through the shop policies before making a purchase to see information on production times, shipping, and ring care.\n\nhttps://www.etsy.com/ca/shop/OriginHG?ref=l2-shopheader-name\n\nNeed an order made or shipped fast? Upgrade your order using these options:\n\nPriority manufacturing (made within 16 days for knives, or rings WITHOUT stainless steel): \nhttps://www.etsy.com/ca/listing/113316967/prioritize-an-item-to-be-made-more?ref=shop_home_active_1\n\nShipping Upgrades: \nhttps://www.etsy.com/ca/shop/OriginHG?ref=l2-shopheader-name&section_id=12644292",
