        "announcement": "I love to discover, collect and share beautiful things that I come across in my every day. It is with the greatest of pleasure that you can see what I see with a sense of wonderment at what the human spirit has produced. \n\nMy greatest interest is the Mid Century Modern with its wonderful complexity of colors and textures and yet the simplicity of the Danish modern I find it&#39;s dichotomy endlessly fascinating. I will stray when something wonderful catches my eye as you will see in my vast and varied collection. \n\nIt really is my greatest pleasure to share this passion of collecting and talking about these beautiful objects. They speak for me and who I am. So please feel free to comment, ask, or add to my knowledge. I am sincerely grateful.",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": null,
        "sale_message": null,
        "digital_sale_message": null,
        "last_updated_tsz": 1553574907,
        "listing_active_count": 1040,
        "digital_listing_count": 0,
        "login_name": "kunarooney",
        "accepts_custom_requests": false,
        "policy_welcome": "What you can expect to see in my store? I lean towards the mid century simplicity or the over-the-top individualism, the optimism, the vibrancy but my tastes are extremely eclectic and you&#39;ll see a wide range on both sides of that mid century period. Glass and pottery are my real passions and handmade trumps all.\n\nYour pleasure, your satisfaction and sharing my passion is my mission! ",
        "policy_payment": "I would expect that items are paid for within a reasonable time from when they are purchased. If you have special circumstances and you would like me to hold an item then by all means send me a note and I am more than happy to accommodate every reasonable wish thank you. ",
        "policy_shipping": "I do my very best to ship on the same or very next day. With some very fragile items I use a very special packing technique that does take an extra day or two but I will inform you of this immediately. \n\nI pack every item with the greatest of care.",
        "policy_refunds": "I do my very best to describe my little beauties to the best of my abilities. I am purveyor of much but cannot compare to a single minded enthusiast in their own arena. If I have missed something I am happy to discuss it. \n\nI do the best I can to package with the care I would expect on the receiving end. That said there is a balance between postage costs and item safely. Double boxing and the likes are mostly prohibitive. An item broken by those maniacs at the post office will promptly be refunded. ",
