        "title": "Custom Jewelry Handmade w/Recycled Gold in Seattle",
        "announcement": "Happy Holidays Etsy Shoppers!!!   Welcome to my little corner here on ETSY.\n\nIt&#39;s that time of the year.. busy elf-ing away.  Due to the amount of early custom and holiday orders, turnaround time for all work won&#39;t be fulfilled til the New Years.  Please note the last day of shipping for all READY to SHIP items is Wednesday Dec 19th.\n\nShop will be closed Dec 20th - January 2nd\n\nThank you! - Michelle Lenáe\n\n&gt;&gt;&lt;&gt;&lt;&lt;\n\nPlease visit my website for more jewelry including more custom items.\nhttp:/michellelenae.com\n\nEvery piece of jewelry is originally designed and handmade to order by me in my Seattle studio. All metal used is from recycled precious metals. I select every single gemstone individually for it&#39;s unique one of a kind natural beauty and purchase from trusted dealers with honest & responsible  business practices. \n\nI also offer recycling and reclaiming of your old unworn jewelry!  Please contact me if this interests you. \n\nTurn-around times are estimated according to design and vary from listing to listing. Average turn-around time for custom jewelry ranges between 3-7 weeks. Please refer to the individual listing for the estimates turn-around time and my shop policies for complete shipping information.\n\nI offer RUSH-MY-ORDER for an added fee that includes expedited shipping. Contact me if this is something you might need to add to your order. \n\n&gt;&gt;&lt;&gt;&lt;&lt;\nMichelle Lenae Jewelry and BentML jewelry are the homes of the Original Modern Mountain Ring Collection & personalized jewelry for travelers. \nShop the full collection at; http://www.BentMLjewelry.etsy.com and MichelleLenae.com\n\nFollow my work!\nFacebook: MichelleLenaeJewelry\nInstagram: @michellelenaejewelry\n\n&gt;&gt;&lt;&lt;&gt;&gt;&lt;&lt;",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": "ON A VACATION!!  SHOP WILL REOPEN MARCH 3rd.  THANKS FOR STOPPING BY!",
        "sale_message": "Thank you for supporting my passion in creating fine handmade jewelry!  \r\n\r\nYour custom handcrafted piece of jewelry should arrive within 4-6 weeks, unless otherwise noted. \r\n\r\n&lt;&gt; Feedback is very helpful here on Etsy. I would love if you can share a little  about your experience & as a thank you, a coupon code for anything in my shop will be emailed to you.\r\n\r\nI will contact you again when your order is ready to ship.\r\n\r\n\r\nKindly,\r\nMichelle Lenáe",
        "digital_sale_message": null,
        "last_updated_tsz": 1553574635,
        "listing_active_count": 228,
        "digital_listing_count": 0,
        "login_name": "michellelenae",
        "accepts_custom_requests": true,
        "policy_welcome": "I am a Seattle based Jewelry Designer, Gold and Silversmith who specializes in fine, individually handcrafted jewelry. Everything is created by my two hands for lasting integrity, with love and passion for the creative process.\r\n\r\nMy work on Etsy is a collection of heirloom quality one-of-a-kind pieces, explorations in techniques, limited-editions, and jewelry made simply for the love of it.  Everything is made-to-order unless otherwise specified.  \r\n\r\nI am happy to assist you to select or custom design jewelry for you or a loved one. I want you to be thrilled with your purchase, feel satisfied that you received high quality pieces, and know that you own one-of-a-kind Artisan jewelry.\r\n\r\nAll metal used in my studio is from recycled metals. All diamonds and gemstones are individually handpicked by me and purchased from trusted dealers who practice fair & responsible sourcing and mining. All of my custom cut Dahlia and Pyramid facets are cut here in the US.\r\n\r\nI offer recycling for your old unworn jewelry as credit towards new custom jewelry! Please contact me for more info.\r\n\r\nYou can find more personal details about me as a designer and metalsmith on my shop page under my profile.\r\n\r\nDue to the nature of handmade jewelry, if you are ordering from a Made-to-Order listing there will be variances in both stone and metal.  Please be assured that the style of your piece will be as close as humanly possible to the sample image you are ordering from. Because of this, your piece of jewelry will be uniquely yours: no one else will have one exactly like it. This is what makes each piece of jewelry a one-of-a-kind and your own personal treasure.\r\n\r\n&lt;&lt; &gt;&gt;\r\n",
        "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
        "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nESTIMATED SHIPPING TIME\nCanada: 3 - 5 business days\nNorth America: 3 - 5 weeks\nEurope: 4 - 6 weeks\n\nI'll do my best to meet these shipping estimates, but cannot guarantee them. Actual delivery time will depend on the shipping method you choose.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
        "policy_refunds": "I DON'T ACCEPT RETURNS, EXCHANGES, OR CANCELLATIONS\nBut please contact me if you have any problems with your order.",
