        "vacation_autoreply": "Thank you for your interest in my work.  I am currently away on a vacation out of the country.  \r\n\r\nIf you are interested in custom work, please contact my personal email: studio@michellelenae.com   \r\n \r\nThank you again for you for your interest and I will be in touch with you soon!\r\n\r\nKindly,\r\nMichelle Lenae",
