        "is_vacation": false,
        "vacation_message": "On vacation! I&#39;ll be back on August 18.",
        "sale_message": "Great thanks for your purchase!\r\n\r\nI make every effort to print and ship orders within 24 hours, though occasionally it might take a little longer.\r\n\r\nPrior to printing and shipping your order, I will send you a proof for approval. Once it&#39;s approved, I&#39;ll contact you again to let you know when the order is being shipped.\r\n\r\nIf you ordered a canvas print, please note that, as stated in the description for the item you ordered, canvas prints can take up to 12 business days to receive.\r\n\r\nExtra patience may also be required for international deliveries. \r\n\r\nThanks,\r\nRobert\r\n",
        "digital_sale_message": "Thanks for your purchase!\r\n\r\nJust to remind you:\r\n► This is a purchase for a downloadable file. All you need to do is click the &quot;download&quot; button, and then save the file to your computer. \r\n► Once you have downloaded the file, feel free to print it at any size you want, up to 11x14&quot;.\r\n► Printing at sizes larger than 11x14&quot; may result in blurry prints, which is why I offer a listing -- https://www.etsy.com/listing/243590553 -- for files that print at larger sizes.)\r\n► All downloaded images can be printed either on paper or gallery-wrapped canvas.\r\n► The dimensions of the image you receive are set for 8x10s and 11x14s. Other sizes (such as 4x6s, 8x12s, and square prints) will need to be cropped, which you can do when you order the print from your local printing company.\r\n",
        "last_updated_tsz": 1553565686,
        "listing_active_count": 741,
        "digital_listing_count": 0,
        "login_name": "vintagerobert",
        "accepts_custom_requests": true,
        "policy_welcome": "Welcome to my shop! All of the images you see here were taken by me and are professionally printed with archival paper and inks.\r\n\r\nMost photographs are available in various sizes, so if you don&#39;t see the size you&#39;re looking for, or have any questions at all, please contact me.\r\n\r\nI welcome both bulk and retail / wholesale orders. Please contact me for prices and details.",
        "policy_payment": "I accept payment by PayPal and credit card (processed through PayPal).\r\n\r\nI ship prints only after I have received payment. If you have any questions about the checkout process or change your mind after placing an order, please contact me so that I can assist you with the payment process or cancel the order if you wish.\r\n\r\nIf payment hasn&#39;t been made within 7 days of placing an order, with no email correspondence, I will cancel the order.",
        "policy_shipping": "I will ship your order to the address listed in your ETSY RECEIPT, not your Paypal address. Please make sure it is the correct address, or let me know if the shipping address is different than indicated on the receipt. If a package is returned to me because of an incorrect address, I will have to charge for shipping again.\r\n\r\nI strive to ship all prints purchased on a business day within 24 hours of receiving payment. Occasionally--like if I&#39;m out on a photo trip for a couple days--shipping may take up to three days after payment. If I&#39;m out of my studio for an extended period, I&#39;ll announce that in my shop info section.\r\n\r\nI will send you a confirmation email after your order has been shipped. My prints are sealed inside a plastic sleeve to protect against moisture damage and then put into a rigid cardboard envelope.\r\n\r\nEXPRESS SHIPPING\r\nIf you need an item to arrive sooner, I can offer express shipping options at a reasonable cost. Please contact me for details prior to making a purchase.\r\n\r\nLOST AND DAMAGED ITEMS\r\nI am not responsible for prints that are lost or damaged during shipping. However, I will replace small orders free of charge. For larger orders and larger prints, items will be replaced only if you purchase an insured shipping option or pay a small fee to cover the additional cost. A package is considered lost if it has not arrived 6 weeks after the shipping date. I ship replacements only after the full six weeks.\r\n\r\nCUSTOMS CHARGES\r\nLarger items that are shipped outside of the United States may incur additional fees, taxes, tarifs, duties, or customs charges. Since I cannot predict or calculate these charges, the buyer is responsible for their payment should they occur. Returns will not be accepted due to customs fees.",
        "policy_refunds": "If you are not satisfied with your purchase, I will exchange your item(s) or refund your money (minus shipping costs) up to 14 days after you have received your order. You are responsible for returning items in their original condition as well as return shipping costs.",
        "policy_additional": "INFORMATION ABOUT GALLERY-WRAPPED CANVAS PRINTS\r\n-- Canvas prints are ready to hang. No framing is required! Just take it out of the package and hang it on your wall!\r\n-- Images are printed on archival artist canvas, then firmly wrapped and secured around a sturdy, solid frame, with neat, perfectly folded corners.\r\n-- Sawtooth hanging hardware is pre-installed.\r\n-- Canvas prints are finished with a clear acrylic coating, providing a scratch-resistant outer layer with a satin luster.\r\n-- The sides of the print are wrapped around the stretcher bars, giving the print a gorgeous three-dimensional look.\r\n-- I always try to begin the printing process within 24 hours of receiving the order. However, please note that canvas prints can take much longer to deliver than paper prints. CANVAS PRINTS CAN TAKE 10-12 BUSINESS DAYS TO DELIVER. If that doesn&#39;t work for you, I recommend that you order a paper print instead.",
