        "policy_welcome": "Welcome to my shop! All of the images you see here were taken by me and are professionally printed with archival paper and inks.\r\n\r\nMost photographs are available in various sizes, so if you don&#39;t see the size you&#39;re looking for, or have any questions at all, please contact me.\r\n\r\nI welcome both bulk and retail / wholesale orders. Please contact me for prices and details.",
        "policy_payment": "I accept payment by PayPal and credit card (processed through PayPal).\r\n\r\nI ship prints only after I have received payment. If you have any questions about the checkout process or change your mind after placing an order, please contact me so that I can assist you with the payment process or cancel the order if you wish.\r\n\r\nIf payment hasn&#39;t been made within 7 days of placing an order, with no email correspondence, I will cancel the order.",
        "policy_shipping": "I will ship your order to the address listed in your ETSY RECEIPT, not your Paypal address. Please make sure it is the correct address, or let me know if the shipping address is different than indicated on the receipt. If a package is returned to me because of an incorrect address, I will have to charge for shipping again.\r\n\r\nI strive to ship all prints purchased on a business day within 24 hours of receiving payment. Occasionally--like if I&#39;m out on a photo trip for a couple days--shipping may take up to three days after payment. If I&#39;m out of my studio for an extended period, I&#39;ll announce that in my shop info section.\r\n\r\nI will send you a confirmation email after your order has been shipped. My prints are sealed inside a plastic sleeve to protect against moisture damage and then put into a rigid cardboard envelope.\r\n\r\nEXPRESS SHIPPING\r\nIf you need an item to arrive sooner, I can offer express shipping options at a reasonable cost. Please contact me for details prior to making a purchase.\r\n\r\nLOST AND DAMAGED ITEMS\r\nI am not responsible for prints that are lost or damaged during shipping. However, I will replace small orders free of charge. For larger orders and larger prints, items will be replaced only if you purchase an insured shipping option or pay a small fee to cover the additional cost. A package is considered lost if it has not arrived 6 weeks after the shipping date. I ship replacements only after the full six weeks.\r\n\r\nCUSTOMS CHARGES\r\nLarger items that are shipped outside of the United States may incur additional fees, taxes, tarifs, duties, or customs charges. Since I cannot predict or calculate these charges, the buyer is responsible for their payment should they occur. Returns will not be accepted due to customs fees.",
