        "policy_additional": "INFORMATION ABOUT GALLERY-WRAPPED CANVAS PRINTS\r\n-- Canvas prints are ready to hang. No framing is required! Just take it out of the package and hang it on your wall!\r\n-- Images are printed on archival artist canvas, then firmly wrapped and secured around a sturdy, solid frame, with neat, perfectly folded corners.\r\n-- Sawtooth hanging hardware is pre-installed.\r\n-- Canvas prints are finished with a clear acrylic coating, providing a scratch-resistant outer layer with a satin luster.\r\n-- The sides of the print are wrapped around the stretcher bars, giving the print a gorgeous three-dimensional look.\r\n-- I always try to begin the printing process within 24 hours of receiving the order. However, please note that canvas prints can take much longer to deliver than paper prints. CANVAS PRINTS CAN TAKE 10-12 BUSINESS DAYS TO DELIVER. If that doesn&#39;t work for you, I recommend that you order a paper print instead.",
